    "X_test_scaled = scaler.transform(X_test)\n",
    "\n",
    "# Test polynomial degrees\n",
    "for degree in range(1, 6):\n",
    "    print(f\"\\nTesting Polynomial Degree: {degree}\")\n",
    "    \n",
    "    # Create polynomial features\n",
    "    poly = PolynomialFeatures(degree=degree)\n",
    "    X_poly_train = poly.fit_transform(X_train_scaled)\n",
    "    X_poly_test = poly.transform(X_test_scaled)\n",
    "    \n",
    "    # Train the model\n",
    "    model = LinearRegression()\n",
    "    model.fit(X_poly_train, y_train)\n",
    "    \n",
    "    # Make predictions\n",
    "    y_pred = model.predict(X_poly_test)\n",
    "    \n",
    "    # Evaluate the model\n",
    "    mse = mean_squared_error(y_test, y_pred)\n",
    "    r2 = r2_score(y_test, y_pred)\n",
    "    \n",
    "    print(f\"Mean Squared Error: {mse}\")\n",
    "    print(f\"R-squared: {r2}\")\n",
    "    \n",
    "    # Visualization\n",
    "    plt.figure(figsize=(10, 6))\n",
    "    plt.scatter(X, y, color='red', label='Actual data')\n",
    "    X_range = np.linspace(X.min(), X.max(), 100).reshape(-1, 1)\n",
    "    X_range_scaled = scaler.transform(X_range)\n",
    "    X_range_poly = poly.transform(X_range_scaled)\n",
    "    y_range_pred = model.predict(X_range_poly)\n",
    "    plt.plot(X_range, y_range_pred, label=f'Polynomial Degree {degree}')\n",
    "    plt.xlabel('Log_MPA')\n",
    "    plt.ylabel('Log_Fishery_Consumption')\n",
    "    plt.title(f'Polynomial Regression (Degree {degree})')\n",
    "    plt.legend()\n",
    "    plt.show()\n"
